import React, { useState } from 'react'
import axios from 'axios'
import './patients.css'

function Patients() {

  // const [formData, setFormData] = useState({});

  const [responseMessage, setResponseMessage] = useState('');

  // const handleInputChange = (e) => {
  //   const { name, value } = e.target;
  //   setFormData({
  //     ...formData,
  //     [name]: value, // Dynamically setting the name or email based on the input that's changed.
  //   });
  // };

  const [formData, setFormData] = useState({
    cin: '',
    name: '',
    date: '',
    sex: 'male',
    tel: '',
    email: '',
    address: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  // const handleSubmit = async (e) => {
  //   e.preventDefault();

  //   try {
  //     const response = await axios.post('http://localhost:5000/add_patient', formData);
  //     console.log(response.data.message); // Log success message from backend
  //     // Optionally, reset the form data after successful submission
  //     setFormData({
  //       cin: '',
  //       name: '',
  //       date: '',
  //       sex: 'male',
  //       tel: '',
  //       email: '',
  //       address: ''
  //     });
  //   } catch (error) {
  //     console.error('Failed to add patient:', error.message);
  //     // Handle error gracefully (e.g., display error message to user)
  //   }
  // };

  const handleSubmit = async (event) => {
    event.preventDefault();

    // const response = await fetch('http://127.0.0.1:5000/add_person', {
    //   method: 'POST',
    //   headers: {
    //     'Content-Type': 'application/json',
    //   },
    //   body: JSON.stringify(formData),
    // });
    // console.log(response)

    // const data = await response.json();

    // setResponseMessage(data.message);

    // if (response.status === 201) {
    //   // Handle success
    //   console.log("Success:", data);
    // } else {
    //   // Handle failure
    //   console.error("Failure:", data);
    // }
    try {
      console.log(formData)
      const response = await axios.post('http://127.0.0.1:5000/add_patient', formData, {
        headers: {
          'Content-Type': 'application/json'
        }
      });

      // Extract data from the response
      const data = response.data;
      setResponseMessage(data.message);  // Assuming this is a function you've defined to set a response message
      setFormData({
        cin: '',
        name: '',
        date: '',
        sex: 'male',
        tel: '',
        email: '',
        address: ''
      });

      if (response.status === 201) {
        // Handle success
        console.log("Success:", data);
      } else {
        // Handle failure
        console.error("Failure:", data);
      }

    } catch (error) {
      // Handle errors from the request itself (e.g., network errors, timeout errors)
      console.error("Error during the request:", error.message);
    }
  };

  return (
    <div>
      <h2 id='patients'>Patients</h2>

      <form className="form1">
        <h4>Find a patient:</h4>
        <div className="row">
          <input type="text" name="cin" placeholder="CIN" required />
          <button type="submit">Search</button>
        </div>
      </form>

      <form className="form1" onSubmit={handleSubmit}>
        <h4>Add a patient:</h4>
        <div className="row">
          <input type="text" name="cin" placeholder="CIN" value={formData.cin} onChange={handleChange} required />
          <input type="text" name="name" placeholder="Full Name" value={formData.name} onChange={handleChange} required />
        </div>
        <div className="row">
          <label htmlFor="date">Date of birth:</label>
          <input type="date" name="date" value={formData.date} onChange={handleChange} required />
          <label htmlFor="sex">Sex:</label>
          <select name="sex" id="sex" value={formData.sex} onChange={handleChange}>
            <option value="male">Male</option>
            <option value="female">Female</option>
          </select>
        </div>
        <div className="row">
          <input type="tel" name="tel" placeholder="Phone number" value={formData.tel} onChange={handleChange} required />
          <input type="email" name="email" placeholder="Email" value={formData.email} onChange={handleChange} required />
        </div>
        <input type="text" name="adress" placeholder="Adress" value={formData.address} onChange={handleChange} required />
        <button type="submit">Add</button>
      </form>
      {responseMessage && <p style={{ color: 'black' }}>{responseMessage}</p>}
    </div>
  )
}

export default Patients
